import React from "react";
import john from "assets/img/examples/clem-onojeghuo.jpg";
import tanya from "assets/img/examples/cynthia-del-rio.jpg";
import {
  Grid,
  Typography,
  Card,
  CardActionArea,
  CardMedia,
  Container,
  CardContent,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { title } from "../../../assets/jss/material-kit-react.js";
import { red, blue, green, lightBlue } from "@material-ui/core/colors";
import { AutoRotatingCarousel, Slide } from "material-auto-rotating-carousel";
const { withStyles } = require("@material-ui/core/styles");

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    padding: "70px 0",
  },
  slide: {
    flexGrow: 1,
    align: "center",
  },
  slideX: {
    flexGrow: 1,
    align: "center",
    paddingTop: "5%",
  },
  product: {
    //height: 400,
    //width: 800,
    backgroundColor: theme.palette.primary.main,
    //padding: "70px 0",
  },
}));

export default function AutoGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Container className={classes.slideX} fixed>
        <h2 className={classes.title}>Here is our product</h2>
        <Grid
          container
          spacing={3}
          className={classes.slide}
          direction="row"
          justify="flex-start"
          alignItems="center"
        >
          <Grid Item xs={12} lg={12}>
            <Slide
              media={
                <img src="http://www.icons101.com/icon_png/size_256/id_79394/youtube.png" />
              }
              mediaBackgroundStyle={{ backgroundColor: "#fff" }}
              //style={{ backgroundColor: lightBlue[200] }}
              title="This is a very cool feature"
              subtitle="Just using this will blow your mind."
              className={classes.product}
            />
            <br></br>
          </Grid>
          <br></br>
          <Grid Item xs={12} lg={12}>
            <Slide
              media={
                <img src="http://www.icons101.com/icon_png/size_256/id_80975/GoogleInbox.png" />
              }
              mediaBackgroundStyle={{ backgroundColor: "#fff" }}
              //style={{ backgroundColor: "primary" }}
              title="Ever wanted to be popular?"
              subtitle="Well just mix two colors and your are good to go!"
              className={classes.product}
            />
          </Grid>
          <br></br>
          <Grid Item xs={12} lg={12}>
            <Slide
              media={
                <img src="http://www.icons101.com/icon_png/size_256/id_76704/Google_Settings.png" />
              }
              mediaBackgroundStyle={{ backgroundColor: "#fff" }}
              //style={{ backgroundColor: green[600] }}
              title="May the force be with you"
              subtitle="The Force is a metaphysical and ubiquitous power in the Star Wars fictional universe."
              className={classes.product}
            />
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
